import React from 'react'

const Checkout = () => {
    return (
        <div>
              <h4 style={{ backgroundColor: "rgb(65, 95, 183)", color: "white", display: "flex", alignItems: "center", height: "50px" }} >Food's Resturant</h4>
            <h2 style={{ display: "flex", justifyContent: "center", marginTop: "177px" }}>Checkout</h2>
            <h3 style={{ marginLeft: "20%" }}>Thank you for your Order.</h3>

        </div>
    )
}

export default Checkout
